import React from 'react';
import Todo from './Todo';

function TodoList({ todos, itsComplete }) {

    return (
        <ul>
            {todos.map(todo => (
                <Todo key={todo.id} todo={todo} itsComplete={itsComplete} />
            ))}
        </ul>
    );
}



export default TodoList;
